import { useCallback } from 'react';
import './IniciarSesion.css'; // Estilos específicos
import muñecosImage from './Imagenmuñecos.png'; 

const IniciarSecion = () => {
    const onBotonContainerClick = useCallback(() => {
        // Agrega tu código aquí
    }, []);

    return (
        <div className="iniciarsecion">
            <div className="content-container">
                <div className="form-container">
                    <h2 className="iniciar-secin">Iniciar sesión</h2>
                    <div className="input-group">
                        <input type="text" id="numero" className="escribirlo" placeholder="Número de celular" />
                    </div>
                    <div className="input-group">
                        <input type="password" id="contraseña" className="escribirlo" placeholder="Contraseña" />
                    </div>
                    <button className="boton" onClick={onBotonContainerClick}>
                        Iniciar Sesión
                    </button>
                    <div className="extra-options">
                        <label className="remember-me">
                            <input type="checkbox" />
                            Recordarme
                        </label>
                        <a href="#" className="help-link">¿Necesitas ayuda?</a>
                    </div>
                    <div className="cuadro-inner">
                        <span>¿No tienes una cuenta?</span>
                        <a href="#" className="register-link">Registrarse coder/Crafter</a>
                    </div>
                </div>
                <div className="image-container">
                    <img className="imagenmuecos-icon" alt="Muñecos" src={muñecosImage} />
                </div>
            </div>
        </div>
    );
};

export default IniciarSecion;
